text:
Replying to @CPMumbaiPolice We are receiving messages by the dozens (WhatsApp )  about total lockdown of Mumbai and army being deployed. 

Ppl are making plans to hit stores to stock up. 

@MumbaiPolice needs to send SMS to all mobiles in Mumbai with your above message. 

Do it today.
@CMOMaharashtra

Replying to @CPMumbaiPolice and @MrsGandhi . better to deploy @adgpi soon to save the rest of Maharashtra people.  You guys failed utterly in implementing lockdown.  Cases are raising from day 1 till date without any dip.

Feel sad for people of Maharashtra 
@HMOIndia
